export const AddCategory = () => {

  const [inputVal, setinputVal] = useState('Wenas')
  const handleInputChange = (e) =>{
    //   console.log(e.target.value)
      setinputVal(e.target.value)
  }

  return (
    <>
        <input 
            type="text"
            value={ inputVal }
            onChange={ handleInputChange }
        />
    </>
  )
}
